(4, '1F7WTYRGQ7', 4, 'ESCUELA DE KARATE RENEDO', '', 'El deporte es una herramienta pedagógica necesaria para el desarrollo integral de nuestros niños, jóvenes y adultos. Entre los extremos representados por la competición de alto nivel y el deporte recreativo, se encuentran el deporte educativo que pretende contribuir al desarrollo armónico y potenciar los valores del individuo.', 'Colegio \'\'Virgen de Valencia\'\', Renedo de Piélagos', 'renedo@escuelakarate.es', '658059375', '', '', 1, '2022-03-13 12:19:51', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
